class EmailAuthBackend:
    """
    Unified authentication backend that can authenticate against either the
    default Django User model or a custom Provider model. It also supports
    simple user lookup without password verification.
    """

    def authenticate(self, request=None, username=None, password=None, user_model=None):
        """
        Authenticate a user by email.

        Parameters
        ----------
        request : HttpRequest, optional
            The request object (unused but kept for compatibility with Django).
        username : str, optional
            The email address to authenticate.
        password : str, optional
            The password to verify. If omitted, the method will simply return
            the user instance if found.
        user_model : Model, optional
            The model to query. Defaults to the Django User model. Pass
            ``Provider`` to authenticate against the Provider model.

        Returns
        -------
        User instance or None
            The authenticated user or None if authentication fails.
        """
        if user_model is None:
            user_model = django_User

        try:
            if user_model == django_User:
                user = user_model.objects.get(email=username)
            else:
                # For Provider, the email is stored on the related User instance
                user = user_model.objects.filter(idUser__mail__contains=username).first()
        except Exception:
            return None

        if not user:
            return None

        # If no password is provided, just return the user (lookup only)
        if password is None:
            return user

        if check_password(password, user.password):
            return user

        return None


