def set_main_module(file_path):
    Context.g_module = Context.load_module(file_path)
    Context.g_module.root_path = file_path

    def set_def(obj):
        name = obj.__name__
        if not name in Context.g_module.__dict__:
            setattr(Context.g_module, name, obj)

    for k in [update, dist, distclean, distcheck, update]:
        set_def(k)

    if not 'init' in Context.g_module.__dict__:
        Context.g_module.init = Utils.nada
    if not 'shutdown' in Context.g_module.__dict__:
        Context.g_module.shutdown = Utils.nada
    if not 'options' in Context.g_module.__dict__:
        Context.g_module.options = Utils.nada


def parse_options():
    Context.create_context('options').execute()
    if not Options.commands:
        Options.commands = [default_cmd]
    Options.commands = [x for x in Options.commands if x != 'options']
    Logs.verbose = Options.options.verbose
    Logs.init_log()
    if Options.options.zones:
        Logs.zones = Options.options.zones.split(',')
        if not Logs.verbose:
            Logs.verbose = 1
    elif Logs.verbose > 0:
        Logs.zones = ['runner']
    if Logs.verbose > 2:
        Logs.zones = ['*']


def run_command(cmd_name):
    ctx = Context.create_context(cmd_name)
    ctx.log_timer = Utils.Timer()
    ctx.options = Options.options
    ctx.cmd = cmd_name
    ctx.execute()
    return ctx


def run_commands():
    parse_options()
    run_command('init')
    while Options.commands:
        cmd_name = Options.commands.pop(0)
        ctx = run_command(cmd_name)
        Logs.info('%r finished successfully (%s)' % (cmd_name, str(ctx.log_timer)))
    run_command('shutdown')


def _can_distclean(name):
    for k in '.o .moc .exe'.split():
        if name.endswith(k):
            return True
    return False


def distclean_dir(dirname):
    for (root, dirs, files) in os.walk(dirname):
        for f in files:
            if _can_distclean(f):
                fname = root + os.sep + f
                try:
                    os.unlink(fname)
                except OSError:
                    Logs.warn('Could not remove %r' % fname)
    for x in [Context.DBFILE, 'config.log']:
        try:
            os.unlink(x)
        except OSError:
            pass
    try:
        shutil.rmtree('c4che')
    except OSError:
        pass


def distclean(ctx):
    '''removes the build directory'''
    lst = os.listdir('.')
    for f in lst:
        if f == Options.lockfile:
            try:
                proj = ConfigSet.ConfigSet(f)
            except IOError:
                Logs.warn('Could not read %r' % f)
                continue
            if proj['out_dir'] != proj['top_dir']:
                try:
                    shutil.rmtree(proj['out_dir'])
                except IOError:
                    pass
                except OSError as e:
                    if e.errno != errno.ENOENT:
                        Logs.warn('project %r cannot be removed' % proj[Context.OUT])
            else:
                distclean_dir(proj['out_dir'])
            for k in (proj['out_dir'], proj['top_dir'], proj['run_dir']):
                try:
                    os.remove(os.path.join(k, Options.lockfile))
                except OSError as e:
                    if e.errno != errno.ENOENT:
                        Logs.warn('file %r cannot be removed' % f)
        if f.startswith('.waf') and not Options.commands:
            shutil.rmtree(f, ignore_errors=True)


class Dist(Context.Context):
    '''creates an archive containing the project source code'''
    cmd = 'dist'
    fun = 'dist'
    algo = 'tar.bz2'
    ext_algo = {}

    def execute(self):
        self.recurse([os.path.dirname(Context.g_module.root_path)])
        self.archive()

    def archive(self):
        import tarfile
        arch_name = self.get_arch_name()
        try:
            self.base_path
        except AttributeError:
            self.base_path = self.path
        node = self.base_path.make_node(arch_name)
        try:
            node.delete()
        except Exception:
            pass
        files = self.get_files()
        if self.algo.startswith('tar.'):
            tar = tarfile.open(arch_name, 'w:' + self.algo.replace('tar.', ''))
            for x in files:
                self.add_tar_file(x, tar)
            tar.close()
        elif self.algo == 'zip':
            import zipfile
            zip = zipfile.ZipFile(arch_name, 'w', compression=zipfile.ZIP_DEFLATED)
            for x in files:
                archive_name = self.get_base_name() + '/' + x.path_from(self.base_path)
                zip.write(x.abspath(), archive_name, zipfile.ZIP_DEFLATED)
            zip.close()
        else:
            self.fatal('Valid algo types are tar.bz2, tar.gz or zip')
        try:
            from hashlib import sha1 as sha
        except ImportError:
            from sha import sha
        try:
            digest = " (sha=%r)" % sha(node.read()).hexdigest()
        except Exception:
            digest = ''
        Logs.info('New archive created: %s%s' % (self.arch_name, digest))

    def get_tar_path(self, node):
        return node.abspath()

    def add_tar_file(self, x, tar):
        p = self.get_tar_path(x)
        tinfo = tar.gettarinfo(name=p, arcname=self.get_tar_prefix() + '/' + x.path_from(self.base_path))
        tinfo.uid = 0
        tinfo.gid = 0
        tinfo.uname = 'root'
        tinfo.gname = 'root'
        fu = None
        try:
            fu = open(p, 'rb')
            tar.addfile(tinfo, fileobj=fu)
        finally:
            if fu:
                fu.close()

    def get_tar_prefix(self):
        try:
            return self.tar_prefix
        except AttributeError:
            return self.get_base_name()

    def get_arch_name(self):
        try:
            self.arch_name
        except AttributeError:
            self.arch_name = self.get_base_name() + '.' + self.ext_algo.get(self.algo, self.algo)
        return self.arch_name

    def get_base_name(self):
        try:
            self.base_name
        except AttributeError:
            appname = getattr(Context.g_module, Context.APPNAME, 'noname')
            version = getattr(Context.g_module, Context.VERSION, '1.0')
            self.base_name = appname + '-' + version
        return self.base_name

    def get_excl(self):
        try:
            return self.excl
        except AttributeError:
            self.excl = Node.exclude_regs + ' **/waf-1.7.* **/.waf-1.7* **/waf3-1.7.* **/.waf3-1.7* **/*~ **/*.rej **/*.orig **/*.pyc **/*.pyo **/*.bak **/*.swp **/.lock-w*'
            nd = self.root.find_node(Context.out_dir)
            if nd:
                self.excl += ' ' + nd.path_from(self.base_path)
            return self.excl

    def get_files(self):
        try:
            files = self.files
        except AttributeError:
            files = self.base_path.ant_glob('**/*', excl=self.get_excl())
        return files


